import styles from './Nav.module.css'
import { Link } from "react-router-dom";









function Nav({onSearch}){

    return(
         <nav className={styles.divNav}>
           <SearchBar onSearch = {onSearch}/>
          /* <Link to="/about">
           <button>About</button>
           </Link>
           <Link to="home">
